import React from "react";
import { useState, useEffect } from "react";

function SideMeniu() {
  const [getComent, setComents] = useState([]);
  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/comments/")
      .then((res) => res.json())
      .then((data) => {
        setComents(data);
      });
  }, []);

  console.log(getComent);

  return (
    <div>
      {getComent.map((x) => (
        <div className="objectas">{x[0].postId}</div>
      ))}
    </div>
  );
}

export default SideMeniu;
